In 1997, Byer made her screenwriting debut with B*A*P*S, starring Halle Berry, as she was unhappy with how her script was changed during the course of filming. In 1998 she decided to direct her next screenplay, Let's Talk About Sex (1998) herself, while also playing a starring role. Byer made a trailer and took it to the Sundance Film Festival, where she gave it to film executives. The film was quickly picked up by Fine Line Features. Byer wrote and directed Love Don't Cost a Thing (2003) for Warner Brothers, based on the hit 1987 movie Can't Buy Me Love.Byer is an active member of Agape International Spiritual Center and an advocate for the foster care system—a system to which she herself once belonged.
